package com.liuyuan.facetime;

import com.liuyuan.facetime.service.PythonService;
import org.junit.jupiter.api.Test;
import org.springframework.boot.test.context.SpringBootTest;

import javax.annotation.Resource;

@SpringBootTest
class FaceTimeApplicationTests {

    @Resource
    private PythonService pythonService;

    @Test
    void generateScriptTest() {
        String condaEnv = "FaceRecognition";
        String projectPath = "insightface_pytorch";
        String filePath = "record_face.py";
        String[] parameters = new String[]{"-u liuyuan"};

        String script = pythonService.generateScript(condaEnv, projectPath,
            filePath, parameters);
        System.out.println("script = " + script);
    }

    @Test
    void runScriptTest() {
        String condaEnv = "FaceRecognition";
        String pythonRootDirectory = "insightface_pytorch";
        String fileName = "record_face.py";
        String[] parameters = new String[]{"-n liuyuan"};


        String script = pythonService.generateScript(condaEnv,
            pythonRootDirectory, fileName, parameters);
        System.out.println("script = " + script);

        String result = pythonService.runScript(script);
        System.out.println("result = " + result);
    }

    @Test
    void userRecordFaceTest() {
        Boolean bool = pythonService.userRecordFace(1);
        System.out.println("bool = " + bool);
    }

    @Test
    void userRecordInformationTest() {
        Boolean bool = pythonService.userRecordInformation(1L, "刘源");
        System.out.println("bool = " + bool);
    }

    @Test
    void userSignInTest() {
        Boolean bool = pythonService.userSignIn();
        System.out.println("bool = " + bool);
    }

    @Test
    void userRecordInformation2Test() {
        String base64Image = "/9j/4AAQSkZJRgABAQAAAQABAAD" +
            "";
        Boolean bool = pythonService.userRecordInformation2(2L, "张三",
            base64Image);
        System.out.println("bool = " + bool);
    }

    @Test
    void userSignIn2Test() {
        String base64Image = "/9j/4AAQSkZJRgABAQAAAQABAAD" +
            "";
        Boolean bool = pythonService.userSignIn2(base64Image);
        System.out.println("bool = " + bool);
    }

}
